    <script>
      function displayOtp(otpCode) {
        var otpDisplayElement = document.getElementById("otpDisplay");

        // Splitting the string into individual digits
        otpCode.split("").forEach(function (digit) {
          var span = document.createElement("span");
          span.textContent = digit;
          otpDisplayElement.appendChild(span);
        });
      }
    </script>
    <style>
      .otp-display {
        display: flex;
        justify-content: space-between;
        width: 240px;
        margin: 0 auto;
      }

      .otp-display span {
        width: 30px;
        height: 40px;
        line-height: 40px;
        border: 1px solid #ccc;
        border-radius: 4px;
        text-align: center;
        font-size: 18px;
      }
    </style>
